<!DOCTYPE html>

<!-- Styles -->
<style>
body {
		-webkit-touch-callout: none;
		-webkit-user-select: none;
		-khtml-user-select: none;
		-moz-user-select: none;
		-ms-user-select: none;
		user-select: none !important;
}
</style>

<style>
@font-face {
    font-family: myFirstFont;
    src: url(alegreyasans-light-webfont.woff);
}
div {
    font-family: myFirstFont;
}

/* Style the tab */
div.tab {
    overflow: hidden;
    border: 0px solid #ccc;
    background-color: #f1f1f1;
    height:5%;
}

/* Style the buttons inside the tab */
div.tab button {
    background-color: inherit;
    float: left;
    border: none;
    outline: none;
    cursor: pointer;
    padding:1% 16px;
    transition: 0.3s;
}

/* Change background color of buttons on hover */
div.tab button:hover {
    background-color: #ddd;
}

/* Create an active/current tablink class */
div.tab button.active {
    background-color: #ccc;
}

/* Style the tab content */
.tabcontent {
    display: none;
    /*padding: 6px 12px;*/
    border: 0px solid #ccc;
    border-top: none;
}
</style>

<!-- Styles -->
<style>
.amcharts-export-menu-top-right {
  top: 0px;
  right: 0;
}

html, body {
  width: 100%;
  height: 100%;
  margin: 0px;
}

#activity {
  width: 100%;
  height: 95%;
  position: relative;
}

#chartdiv, #curtain {
  width: 100%;
  height: 100%;
  position: absolute;
}

#curtain {
  background: rgba(0, 0, 0, 0.8);
  color: #fff;
  font-size: 25px;
}

#curtain span {
  display: block;
  position: absolute;
  top: 60%;
  width: 100%;
  text-align: center;
}

#loading {
display: block;
position: absolute;
margin-top: auto;
margin-bottom: auto;
margin-left: auto;
margin-right: auto;
top: 0;
bottom: 0;
left: 0;
right: 0;
height: 64px;
width: 64px;
text-align: center;
background-attachment: fixed;
background-image: url(loading.gif);
background-repeat: no-repeat;
background-position: center center;
}
</style>
